import math
f = math.factorial
def C(n, r): return f(n)//f(r)//f(n - r)
def A(n):
    s=0
    for k in range(0, n+1):
        s+=(-1)**(n + k) * C(n, k) * (2**k -1)**n
    return 2*s + 2**(n**2) + 2*(2**n - 2)**n - 4*(2**n - 1)**n # _Indranil Ghosh_, Mar 12 2017

